CREATE TABLE users (
    userID INT PRIMARY KEY,
    age INT,
    gender VARCHAR(10),
    country_name VARCHAR(30),
    state_name VARCHAR(50)
);

CREATE TABLE employment (
    userID INT PRIMARY KEY REFERENCES users(userID),
    self_employed INT,
    employer_benefits VARCHAR(50),
    is_tech_company INT,
    employee_total VARCHAR(20)
);

CREATE TABLE mental_health (
    userID INT PRIMARY KEY REFERENCES users(userID),
    family_history VARCHAR(20),
    sought_treatment INT,
    anonymity_protection VARCHAR(20),
    mh_in_interview VARCHAR(10)
);
